interface TwetherPost{
    function mint(bytes memory text, bytes memory media_url, uint parentPost, uint8 postType, uint160 author) external returns (uint);
    function like(uint postId, uint160 author) external;
    function unlike(uint postId, uint160 author) external;
    function getPostAuthor(uint postId) external;
}

interface TwetherMessage{
    function mint(bytes memory text, uint pubkey, address from, address to) external payable returns (uint);
}

contract TwetherProfile is ERC721Enumerable, ERC721Burnable, Pausable, Ownable{

    struct Profile {
        bytes32 name;
        bytes pfp_url;
        bytes bio;
        bytes banner_url;
        uint160[] followers;
        mapping (uint160 => uint256) followerIndex;
        uint160[] following;
        mapping (uint160 => uint256) followingIndex;
        uint[] likes;
        mapping (uint => uint) postToLikeIndex;
        uint[] posts;
        mapping (uint => uint) postToPostIndex;
        uint[] mentions;
        mapping (uint => uint) postToMentionIndex;
        uint[] messages;
        mapping (uint => uint) msgIdToIndex;
    }

    struct ProfileRep {
        bytes32 name;
        bytes pfp_url;
        bytes bio;
        bytes banner_url;
    }

    struct ProfileLite {
        bytes32 name;
        bytes pfp_url;
    }

    TwetherPost private Post;
    TwetherMessage private Message;
    uint public contractBalance;
    uint public pageSize = 100;
    uint public AVG_POST_GAS = 650000;
    uint public AVG_LIKEFOLLOW_GAS = 135000;
    uint public PRICE = 5000000000000000000;

    mapping(uint160 => Profile) private profile;

    modifier paysFeeVar (uint textLength, uint pfpLength){
        //the fee is always a sixth of the avarage gas fee paid (~15%)
        uint gasAmount = ( 1600 * (textLength + pfpLength) ) + 400000;
        uint minFee = gasAmount * (tx.gasprice / 7);
        //requires at least 92% of the min fee (slipage)
        require(msg.value >= (minFee * 90) / 100, "Not enough fee paid");
        contractBalance += msg.value;
        _;
    }

    modifier paysFeeFixed (uint gasAmount){
        //the fee is always a sixth of the avarage gas fee paid (~15%)
        uint minFee = (gasAmount * tx.gasprice) / 6;
        //requires at least 92% of the min fee (slipage)
        require(msg.value >= (minFee * 92) / 100, "Not enough fee paid");
        contractBalance += msg.value;
        _;
    }

    modifier hasProfile (uint160 user){
        require(_exists(user), "address doesn't have a profile");
        _;
    }

    modifier postContractSet{
        require(address(Post) != address(0),"PostPost contract is not setup");
        _;
    }

    event NewLike(address indexed from, uint indexed post);
    event NewComment(address indexed from, bytes32 indexed keyword, address indexed mention, uint post, uint comment_id);
    event NewShare(address indexed from, bytes32 indexed keyword, address indexed mention, uint post, uint share_id);
    event NowFollows(address indexed frollower, address indexed following);
    event NewProfile(address indexed _address, bytes32 indexed name);
    event NewPost(address indexed from, bytes32 indexed keyword, address indexed mention, uint new_post);
    event ChangedName(address indexed _address, bytes32 name);
    event NewMessage(address indexed from, address indexed to, uint indexed msgId, bytes text, uint pubkey, uint amount);
    event SecurityWithdrawal(uint amount);
    event Withdrawal(address indexed _to, uint _value);

    constructor() ERC721("Pro", "PFP"){}

    receive() external  payable
    {
        contractBalance += msg.value;
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual override (ERC721Enumerable, ERC721){
        require(!paused(), "ERC721Pausable: token transfer while paused");
        super._beforeTokenTransfer(from, to, tokenId);
    }

    /**
     * @dev Returns weather a contracts supports a certain Interface.
     * @param interfaceId of the interface to check.
     * @return True if the contract supports such interface.
     */
    function supportsInterface(bytes4 interfaceId) public view virtual override (ERC721, ERC721Enumerable) returns (bool) {
        return interfaceId == type(IERC721).interfaceId || 
                interfaceId == type(IERC721Metadata).interfaceId || 
                super.supportsInterface(interfaceId);
    }

    function setTwetherPostContract(address _address) external onlyOwner {
        Post = TwetherPost(_address);
    }

    function setTwetherMessageContract(address _address) external onlyOwner {
        Message = TwetherMessage(_address);
    }

    function setPageSize(uint _pageSize) external onlyOwner {
        pageSize = _pageSize;
    }

    function setPrice(uint newPrice) external onlyOwner {
        PRICE = newPrice;
    }

    function mint(bytes32 _name, bytes memory _pfp_url,bytes memory _bio, bytes memory _banner_url) external payable{
        require(msg.value >= PRICE, "Not enough money to mint");
        uint160 _id = uint160(_msgSender());
        profile[_id].name = _name;
        profile[_id].pfp_url = _pfp_url;
        profile[_id].bio = _bio;
        profile[_id].banner_url = _banner_url;
        //user always follows himself NOT SURE THO
        // profile[_id].followingIndex[_id] = 0;
        // profile[_id].following.push(_id);
        //
        super._mint(_msgSender(), _id);
        contractBalance += msg.value;
        emit NewProfile(_msgSender(), _name);
    }

    function _addFollowing(uint160 user, uint160 new_following) internal hasProfile(user) hasProfile(new_following) {
        profile[user].followingIndex[new_following] = profile[user].following.length;
        profile[user].following.push(new_following);

        profile[new_following].followerIndex[user] = profile[new_following].following.length;
        profile[new_following].followers.push(user);
    }

    function _addMention(uint160 user, uint _post) internal 
                                                    ///hasProfile(user)
                                                    {
        profile[user].postToMentionIndex[_post] = profile[user].mentions.length;
        profile[user].mentions.push(_post);
    }

    function _removeFollowing(uint160 user, uint160 old_following) internal hasProfile(user) hasProfile(old_following) {
        require(profile[user].following.length > 0, "You are not following this address");
        uint i = profile[user].followingIndex[old_following];
        uint total = profile[user].following.length;

        if (i == 0){
            require(profile[user].following[0] == old_following, "You are not following this address");
        }
        //copy the last item in the array into the old following place. This will override the old follower value.
        if (i != (total - 1)){
            profile[user].followingIndex[profile[user].following[total - 1]] = i;
            profile[user].following[i] = profile[user].following[total - 1];
        }
        //pop the last value which now has a duplicate, so it's fine.
        profile[user].following.pop();
        delete profile[user].followingIndex[old_following];
    }

    function _removeFollower(uint160 user, uint160 old_following) internal {

        uint i = profile[old_following].followerIndex[user];
        uint total = profile[old_following].followers.length;

        //copy the last item in the array into the old following place. This will override the old follower value.
        if (i != (total - 1)){
            profile[old_following].followerIndex[profile[old_following].followers[total - 1]] = i;
            profile[old_following].followers[i] = profile[old_following].followers[total - 1];
        }
        //pop the last value which now has a duplicate, so it's fine.
        profile[old_following].followers.pop();
        delete profile[old_following].followerIndex[user];
    }

    function follow(address _address) external payable paysFeeFixed(AVG_LIKEFOLLOW_GAS){
        uint160 user = _validateUser();
        uint160 new_following = uint160(_address);
        uint possibleIndex = profile[user].followingIndex[new_following];
        if(possibleIndex == 0){
            if(profile[user].following.length > 0){
                require(profile[user].following[0] != new_following,"You already follow this person");
            }
            _addFollowing(user, new_following);
            emit NowFollows(_msgSender(), _address);
            return;
        }revert("You already follow this person");
    }

    function unfollow(address _address) external payable paysFeeFixed(AVG_LIKEFOLLOW_GAS){
        uint160 user = _validateUser();
        uint160 old_following = uint160(_address);

        _removeFollowing(user, old_following);
        _removeFollower(user, old_following);
    }

    function _validateUser() internal view returns (uint160){
        uint160 user = uint160(_msgSender());
        require(_exists(user), "address doesnt have a profile");
        return user;
    }

    function editName(bytes32 new_name) external {
        uint160 user = _validateUser();
        profile[user].name = new_name;
        emit ChangedName(_msgSender(), new_name);
    }

    function editPfp(bytes memory new_pfp) external {
        uint160 user = _validateUser();
        profile[user].pfp_url = new_pfp;
    }

    function editBio(bytes memory new_bio) external {
        uint160 user = _validateUser();
        profile[user].bio = new_bio;
    }

    function editBanner(bytes memory new_banner) external {
        uint160 user = _validateUser();
        profile[user].banner_url = new_banner;
    }


    function _addPost(uint160 user, uint postId) internal {
        profile[user].postToPostIndex[postId] = profile[user].posts.length;
        profile[user].posts.push(postId);
    }

    function _manageKeywordMention(bytes memory text, uint postId) internal returns (uint160, bytes32){
        bytes memory mention = findInString(text, " @");
        bytes32 keyword = bytes32(findInString(text, " #"));
        uint160 mentioned = uint160(stringHexToUint(mention));
        _addMention(mentioned, postId);
        return (mentioned, keyword);
    }

    function post(bytes memory text, bytes memory media_url) external payable postContractSet paysFeeVar(text.length,media_url.length){
        uint160 user = _validateUser();
        uint postId = Post.mint(text, media_url, 0, 0, user);
        _addPost(user, postId);
        (uint160  mention, bytes32  keyword) = _manageKeywordMention(text, postId);
        emit NewPost(_msgSender(), keyword, address(mention), postId);
    }

    function comment(bytes memory text, bytes memory media_url, uint onPost) external payable postContractSet paysFeeVar(text.length, media_url.length){
        uint160 user = _validateUser();        
        uint postId = Post.mint(text, media_url, onPost, 1, user);
        _addPost(user, postId);
        (uint160 mention, bytes32 keyword) = _manageKeywordMention(text, postId);
        emit NewComment(_msgSender(), keyword, address(mention), onPost, postId);
    }

    function share(bytes memory text, bytes memory media_url, uint postToShare) external payable postContractSet paysFeeVar(text.length, media_url.length){
        uint160 user = _validateUser();        
        uint postId = Post.mint(text, media_url, postToShare, 2, user);
        _addPost(user, postId);
        (uint160  mention, bytes32  keyword) = _manageKeywordMention(text, postId);
        emit NewShare(_msgSender(), keyword, address(mention), postToShare, postId);
    }

    function like(uint postId) external payable postContractSet paysFeeFixed(AVG_LIKEFOLLOW_GAS){
        uint160 user = _validateUser();
        uint possibleIndex = profile[user].postToLikeIndex[postId];
        if(possibleIndex == 0){
            if(profile[user].likes.length > 0){
                require(profile[user].likes[0] != postId,"You already like this post");
            }
            profile[user].postToLikeIndex[postId] = profile[user].likes.length;
            profile[user].likes.push(postId);
            Post.like(postId, user);
            emit NewLike(_msgSender(), postId);
            return;
        }revert("You already like this post");
    }

    function unlike(uint postId) external payable postContractSet paysFeeFixed(AVG_LIKEFOLLOW_GAS){
        uint160 user = _validateUser();
        require(profile[user].likes.length > 0, "You didnt like this post");
        uint i = profile[user].postToLikeIndex[postId];
        uint total = profile[user].likes.length;

        if (i==0){
            require(profile[user].likes[0] == postId, "You didnt like this post");
        } 
        if (i != (total - 1)){
            profile[user].postToLikeIndex[ profile[user].likes[total - 1] ] = i;
            profile[user].likes[i] = profile[user].likes[total - 1];
        }
        profile[user].likes.pop();
        delete profile[user].postToLikeIndex[postId];
        Post.unlike(postId, user);
    }

    function findInString(bytes memory textArray, string memory signal) internal pure returns(bytes memory ){
        bytes memory patternFlag = bytes(signal);
        bytes memory response = new bytes(42);
        uint starts;
        bool found = false;
        for (uint i = 0; i <= textArray.length - patternFlag.length; i++) {
            bool flag = true;
            if (!found){
                for (uint j = 0; j < patternFlag.length; j++){
                    if (textArray [i + j] != patternFlag [j]) {
                        flag = false;
                        break;
                    }
                    starts = i;
                }
            }if(flag){
                if (!found){
                    found = true;
                }else{
                    if (textArray[i+1] == bytes1(" ") || i - starts > 42){break;}
                    response[i - starts -1] = textArray[i+1];
                }
            }
        }return response;
    }

    function stringHexToUint(bytes memory _hex) internal pure returns (uint){
        uint256 number = 0;
        for(uint i=0;i<_hex.length;i++){
            number = number << 4; // or number = number * 16 
            number |= numberFromAscII(_hex[i]); // or number += numberFromAscII(b[i]);
        }
        return number; 
    }

    function numberFromAscII(bytes1 b) internal pure returns (uint8 res) {
        if (b>="0" && b<="9") {
            return uint8(b) - uint8(bytes1("0"));
        } else if (b>="A" && b<="F") {
            return 10 + uint8(b) - uint8(bytes1("A"));
        } else if (b>="a" && b<="f") {
            return 10 + uint8(b) - uint8(bytes1("a"));
        }
        return uint8(b); // or return error ... 
    }


    function getLikesByUserPerPage(address user, uint page) external view returns (uint[] memory){
        uint160 id = uint160(user);
        uint total = profile[id].likes.length;
        uint[] memory response = new uint[](pageSize);
        uint i = pageSize*page;
        uint start = i;
        while(total > i && i < start + pageSize){
            response[i - start] = profile[id].likes[total - i -1];
            i+=1;
        }
        return response;
    }

    function getLastXLikes(address user, uint8 amount) public view returns(uint[] memory){
        uint160 id = uint160(user);
        uint total = profile[id].likes.length;
        if (total > amount) {
            uint[] memory response = new uint[](amount);
            uint i = 0;
            while(amount > i ){
                response[i] = profile[id].likes[total - i -1];
                i+=1;
            }
            return response;
         }else{
            return profile[uint160(user)].likes;
         } 
    }

    function getLast10Likes(address user) external view returns (uint[] memory){
        return getLastXLikes(user, 10);
    }

    function getLast100Likes(address user) external view returns (uint[] memory){
        return getLastXLikes(user, 100);
    }

    function getProfile(address _address) external view returns (ProfileRep memory){
        uint160 user = uint160(_address);
        ProfileRep memory response;

        response.name =  profile[user].name;
        response.pfp_url = profile[user].pfp_url;
        response.bio = profile[user].bio;
        response.banner_url = profile[user].banner_url;

        return (response);
    }

    function getProfileLite(address _address) external view returns (ProfileLite memory){
        uint160 user = uint160(_address);
        ProfileLite memory response;
        response.name =  profile[user].name;
        response.pfp_url = profile[user].pfp_url;
        return (response);
    }

    function doIFollowThisAddress(address _address) external view returns(bool){
        uint160 user = _validateUser();
        uint160 followingAddr = uint160(_address);
        uint indexOfAddr = profile[user].followingIndex[followingAddr];
        if (indexOfAddr == 0){
            if(profile[user].following[0] == followingAddr){
                return true;
            }else{
