    function sendMessage(bytes memory cipherText, uint ephimpubkey, address to) external payable{
        uint160 user = _validateUser(); 
        uint _value = msg.value;
        uint msgId = Message.mint{value : _value}(cipherText, ephimpubkey, _msgSender(), to);
        emit NewMessage(_msgSender(), to, msgId, cipherText, ephimpubkey, _value);
        uint msgIndex = profile[user].messages.length;
        profile[user].msgIdToIndex[msgId] = msgIndex;
        profile[user].messages.push(msgId);
    }

    function getMessagesPerPage(address user, uint8 page) external view returns (uint[] memory){
        uint160 id = uint160(user);
        uint total = profile[id].messages.length;
        uint[] memory response = new uint[](pageSize);
        uint i = pageSize*page;
        uint start = i;
        while(total > i && i < start + pageSize){
            response[i - start] = profile[id].messages[total - i -1];
            i++;
        }
        return response;
    }

